import axios from "axios";
import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

export default function RatingTake() {
  const id = useParams();
  const _id = id.id;
      console.log(_id)
  const [data, setData] = useState([]);

  const getRatingById = () => {
    // axios.get(`http://localhost:3030/rating/${_id}`).then((res)=>{
    axios
      .get("http://localhost:3030/rating")
      .then((res) => {
        const MyData = res.data;
        console.log(MyData);
        setData(MyData);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  useEffect(() => {
    getRatingById();
  }, []);

  return (
    <>
      <div>RatingTake</div>
      <div className="card-body">
        <h5 className="card-title">Rating : - {data.rate}</h5>
        <h5 className="card-title">Feedback : - {data.feedback}</h5>
      </div>
    </>
  );
}
